def find_kth_character(k):
    # Find the highest power of 2 less than or equal to k
    n = 0
    while (1 << n) <= k:
        n += 1
    n -= 1

    # Length of the string just before the k-th character is added
    length_before = (1 << n) - 1

    # Position of the k-th character within the string
    position = k - length_before

    # Determine the character at the given position
    if position <= n:
        return chr(ord('a') + position - 1)
    else:
        return find_kth_character(position - n)

